const [open, setOpen] = React.useState(false);
export const Sort = () => {
  <div className="sort">
    <div className="sort__label">
      <b>Сортировка по:</b>
      <span onClick={() => setOpen(!open)}>xxx</span>
    </div>

    <div className="sort__popup">
      <ul>
        <li className={'active'}></li>
      </ul>
    </div>
  </div>;
};
